import React, { useState, useEffect } from "react";
import GolfDataService from "../../services/golf";
import "./nextTournament.css";
import Button from "react-bootstrap/Card";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Card from "react-bootstrap/Card";

function NextTournament() {
  const [nextTournament, setTournament] = useState({});

  useEffect(() => {
    getTournament();
  }, []);

  const getTournament = () => {
    GolfDataService.getNextTournament()
      .then((response) => {
        setTournament(response.data);
      })
      .catch((e) => {
        console.log(e);
      });
  };

  return (
    <div className="componentContainer">
      <Container fluid>
        <Row>
          <Col>
            <Container className="titleSection">
              <div className="titleText">
                Curated stats and hand-picked bets for every PGA Tour Event.
              </div>
            </Container>
          </Col>
          <Col>
            <Container className="tournamentSection">
              <Row className="tournamentRow">
              <Card className="tournamentCard">
                <Card.Img variant="top" src="" />
                <Card.Body>
                  <Card.Title>Next PGA Event</Card.Title>
                  <Card.Text>
                    {nextTournament.Name}
                    <br></br>
                    {nextTournament.Venue}
                    <br></br>
                    Par: {nextTournament.Par}
                    <br></br>
                    Yards:  {nextTournament.Yards}
                  </Card.Text>
                  <Button variant="primary">Go somewhere</Button>
                </Card.Body>
              </Card>

              </Row>
            </Container>
          </Col>
        </Row>
        <Row>
          <Col>
            <Container className="algoPickSection">
              
            </Container>
          </Col>
        </Row>
        <Row>
          <Col>
            <Container className="honorableMentionsSection">
              
            </Container>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default NextTournament;
